tables.table_schema:
CREATE TABLE MachineLearningInsights (
  id INT,
  data_pattern VARCHAR(255),
  data_distribution VARCHAR(255),
  ml_insights TEXT
);

CREATE TABLE Machine_Learning_Insights (
  id SERIAL PRIMARY KEY,
  data_pattern VARCHAR(100),
  distribution VARCHAR(100),
  insight_description TEXT
);

CREATE TABLE Table1 (
    column1 INT,
    column2 TEXT,
    column3 FLOAT
);

CREATE TABLE Table2 (
    column1 TEXT,
    column2 INT,
    column3 DATE
);

CREATE TABLE Table3 (
    column1 FLOAT,
    column2 TEXT,
    column3 BOOLEAN
);

CREATE TABLE data_patterns (
    id INT PRIMARY KEY,
    feature_1 FLOAT,
    feature_2 FLOAT,
    label VARCHAR
);

CREATE TABLE distributions (
    id INT PRIMARY KEY,
    value FLOAT,
    category VARCHAR,
    notes TEXT
);

CREATE TABLE machine_learning (
    id INT PRIMARY KEY,
    model_name VARCHAR,
    accuracy FLOAT,
    parameters JSON
);

CREATE TABLE insights (
    id INT PRIMARY KEY,
    analysis_date DATE,
    insights TEXT,
    recommendation TEXT
);

CREATE TABLE patterns_analysis (
    id INT PRIMARY KEY,
    pattern_name VARCHAR,
    count INT,
    description TEXT
);
